import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Index from '../pages';

const Rute = () => {
    return (
        <Routes>
            <Route path="/" element={<Index/>}/>
            <Route path="/home" element={<Index/>}/>
            <Route path="/list" element={<Index/>}/>
            <Route path="/login" element={<Index/>}/>
        </Routes>
    );
}

export default Rute;
